    private void dummyAgentActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_dummyAgentActionPerformed
       if(solved)
           log.append("The puzzle is already solved, dummy! Pick something else!"+"\n");
       else{
       log.append("Dummy agent brute-forcing...");
       Selector d = new DefaultCellSelector();
       BacktrackingSearch bs = new BacktrackingSearch(x,d);
       Sudoku s = bs.BacktrackingSearch(x);
       solved = true;
       printPuzzle(s);
       assignments.setText(String.valueOf(bs.getAssignments()));
       log.append("Took " +  String.valueOf(bs.getAssignments()) + " assignments to solve!"+"\n");
       resetB.setEnabled(true);
       }
    }//GEN-LAST:event_dummyAgentActionPerformed

    private void selectFileBActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_selectFileBActionPerformed
       JFileChooser fc = new JFileChooser();
       fc.showOpenDialog(null);
       File f = fc.getSelectedFile();
       String filename = f.getAbsolutePath();
       fileNameField.setText(filename);
       load.setEnabled(true);
       log.append("Puzzle selected: " + getName(filename) +"\n");
    }//GEN-LAST:event_selectFileBActionPerformed

    private void loadActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_loadActionPerformed
       String path = fileNameField.getText();
       x = new Sudoku(path);
       printPuzzle(x);
       smartAgent.setEnabled(true);
       dummyAgent.setEnabled(true);
       load.setEnabled(false);
       log.append("Puzzle loaded: " + getName(path) +"\n");
       solved = false;
       resetB.setEnabled(false);
       
    }//GEN-LAST:event_loadActionPerformed
    private String getName(String path){
        String fileName = new File(path).getName();
        return fileName;
    }
